import{_ as e,c as t,o as i,ag as r}from"./chunks/framework.DPDPlp3K.js";const p="/assets/1.oAwwRgXF.webp",s="/assets/2.B97gCqPB.webp",l="/assets/3.BzXm3Jwc.webp",o="/assets/4.CLk4t2N4.webp",n="/assets/5.0F_cIwnC.webp",c="/assets/6.CiRXQDuJ.webp",h="/assets/7.CeJ91v96.webp",d="/assets/8.CFrdVpou.webp",m="/assets/9.SpuBUsOI.webp",b="/assets/10.DE6HBhtf.webp",A="/assets/11.DCrnVZ93.webp",k="/assets/12.DqkfitzN.webp",f="/assets/13.Wa8s-5rb.webp",u="/assets/14.DP1Av7ty.webp",q="/assets/15.CRUQg0bW.webp",P="/assets/16.CwCw9ezG.webp",g="/assets/17.DPyvjVyf.webp",v="data:image/webp;base64,",w="data:image/webp;base64,",U="data:image/webp;base64,",T="data:image/webp;base64,",R="data:image/webp;base64,",V="data:image/webp;base64,",y="data:image/webp;base64,",J="data:image/webp;base64,",Z="data:image/webp;base64,",S="/assets/27.c_7j4rJv.webp",N="/assets/28.CENRq8-j.webp",x="data:image/webp;base64,",z="/assets/30.DOu3Ytex.webp",C="/assets/31.BdfWCnCy.webp",D="data:image/webp;base64,",O="data:image/webp;base64,",B="/assets/34.EUk8JQD9.webp",X="/assets/35.CeY9YK3t.webp",G="data:image/webp;base64,",L="data:image/webp;base64,",Q="data:image/webp;base64,",E="data:image/webp;base64,",I="data:image/webp;base64,",K="/assets/41.BrD-118n.webp",j="/assets/42.C0tbZuXM.webp",H="/assets/43.CCTFTnV7.webp",M="/assets/44.WdqGsX67.webp",F="/assets/45.Deffw-1s.webp",Y="/assets/46.DS1H20no.webp",W="/assets/47.Cevg1I0z.webp",_="/assets/48.DHLOrhfd.webp",$="/assets/49.DhSd1ofJ.webp",aa="/assets/50.Fskbhj-R.webp",ea="/assets/51.DnjKCjjp.webp",ta="/assets/52.ZZ4duzlG.webp",ha=JSON.parse('{"title":"PL的生电教程","description":"","frontmatter":{},"headers":[],"relativePath":"guide/tutorial/survival_redstone.md","filePath":"guide/tutorial/survival_redstone.md"}'),ia={name:"guide/tutorial/survival_redstone.md"};function ra(pa,a,sa,la,oa,na){return i(),t("div",null,a[0]||(a[0]=[r('<h1 id="pl的生电教程" tabindex="-1">PL的生电教程 <a class="header-anchor" href="#pl的生电教程" aria-label="Permalink to &quot;PL的生电教程&quot;">​</a></h1><h2 id="episode-1-基本知识" tabindex="-1">Episode 1 | 基本知识 <a class="header-anchor" href="#episode-1-基本知识" aria-label="Permalink to &quot;Episode 1 | 基本知识&quot;">​</a></h2><h3 id="part-1-认识生电" tabindex="-1">Part 1 | 认识生电 <a class="header-anchor" href="#part-1-认识生电" aria-label="Permalink to &quot;Part 1 | 认识生电&quot;">​</a></h3><h4 id="什么是生电" tabindex="-1">什么是生电？ <a class="header-anchor" href="#什么是生电" aria-label="Permalink to &quot;什么是生电？&quot;">​</a></h4><p>生电，指在生存中运用包括但不限于红石电路与游戏机制（特性）的手段，来实现全自动化或半自动化生产与储存物资。换而言之，生电是一门为了满足生存的需要而出现、由需求端推动但不止于需求端的技术。</p><h4 id="什么是生电机器" tabindex="-1">什么是生电机器？ <a class="header-anchor" href="#什么是生电机器" aria-label="Permalink to &quot;什么是生电机器？&quot;">​</a></h4><p>生电机器，指运用生电相关的知识而创造的、为生存服务的机器。</p><p>判断一台机器是否为生电机器的决定性判据是：这个机器有必要在创造模式中使用吗？如果没有，表明这个机器一定为生电机器；如果有，表明这个机器属于创电的范畴或者尚不能独立完成一些复杂的功能（如单选器）。</p><p>最经典的错误判据是根据该机器所使用的知识来判断该机器是否为生电机器。按照这个判据，全物品就会被判入创电之内，但是全物品显然没有在创造中建造的必要。</p><h4 id="生电是模块化的生电" tabindex="-1">生电是模块化的生电 <a class="header-anchor" href="#生电是模块化的生电" aria-label="Permalink to &quot;生电是模块化的生电&quot;">​</a></h4><p>一切生电机器都是模块化的。大型的生电机器通常都是多个能完成特定功能的模块的组合，而每个小机器又可被切分为更小的模块，直至不可再切分。最小的模块是单个红石元件，但这并不代表不可切分的模块都是一个方块的（甚至有可能不是方块）。</p><p>通常来说，一台生电机器可以被切分为三个模块：物品再生，物品采集（使生物、方块转变为物品形式）与物品收集，有一些机器还有物品输入模块；但全物品是个例外，这是其特殊的功能所决定的。</p><h4 id="生电机器设计的基本流程" tabindex="-1">生电机器设计的基本流程 <a class="header-anchor" href="#生电机器设计的基本流程" aria-label="Permalink to &quot;生电机器设计的基本流程&quot;">​</a></h4><p>正因为生电机器源自于需求端，其目标十分明确：需要获取的物品。从物品出发，查阅该物品的再生方式与采集方式，根据再生方式设计相应的流程，并根据这个流程设计与拼搭模块，最后对走线进行优化就能得到一台生电机器的原型机。而将一台原型机经过生存实装，对出现的各类问题经过修复与改进后，便得到了一台生电机器。</p><p>例如：我们需要获取绿色染料，通过查阅资料（wiki）得知绿色染料由仙人掌烧制而成，而仙人掌通过自然生长再生，当四周有方块时会变为物品。</p><p>通过一定的方式放置仙人掌的阵列，构筑再生模块；通过在仙人掌旁边放置方块，使仙人掌变为物品，构筑采集模块；在仙人掌下方放置水流，流经漏斗上方，构筑收集模块。将三个模块组合，就能得到一台原型机。</p><p>设计一台生电机器很多时候并不需要用到多么高深的红石知识，而需要对游戏机制与常用模块的功能相当熟悉；但是设计新的模块通常需要对红石与各种机制有较为深刻的认识。实际上，仙人掌农场作为mc中极少数没有使用任何红石元件的机器之一，其再生模块的设计经历了多个版本后才有了一个合理的高效设计，足以说明设计一台机器与设计新模块的难度完全不相干。</p><h3 id="part-2-资料的查询" tabindex="-1">Part 2 | 资料的查询 <a class="header-anchor" href="#part-2-资料的查询" aria-label="Permalink to &quot;Part 2 | 资料的查询&quot;">​</a></h3><h4 id="学会查阅wiki" tabindex="-1">学会查阅wiki <a class="header-anchor" href="#学会查阅wiki" aria-label="Permalink to &quot;学会查阅wiki&quot;">​</a></h4><p>由于MC的独特性，每个版本各个方块与生物的特性、物品的再生方式都有所不同。因此作为一名生电玩家，经常性去wiki查阅便成为了重要的一环。在右上角的搜索框搜索相应的名词，即可跳转到与该名词相关的搜索界面，再点击进入相应的词条即可。</p><p>Wiki：<a href="https://minecraft.fandom.com/zh/wiki/Minecraft_Wiki" target="_blank" rel="noreferrer">https://minecraft.fandom.com/zh/wiki/Minecraft_Wiki</a></p><p>Bili镜像：<a href="https://wiki.biligame.com/mc/Minecraft_Wiki" target="_blank" rel="noreferrer">https://wiki.biligame.com/mc/Minecraft_Wiki</a></p><p><img src="'+p+'" alt="1"></p><p class="desc">Wiki</p><p><img src="'+s+'" alt="2"></p><p class="desc">Bili镜像</p><p><img src="'+l+'" alt="3"></p><p class="desc">Wiki搜索界面</p><p><img src="'+o+'" alt="4"></p><p class="desc">词条界面</p><h4 id="了解学习他人的设计" tabindex="-1">了解学习他人的设计 <a class="header-anchor" href="#了解学习他人的设计" aria-label="Permalink to &quot;了解学习他人的设计&quot;">​</a></h4><p>wiki上只提供最基本的知识，而真正踏入生电的大门往往是从借鉴他人的机器开始的。一般来说，可能的机器与模块都已经有人做过了，并放出了存档与投影（Part3中会提到）供学习与改进，有些UP主同时会附上原理讲解（如黑山大叔、肥啾U_ruby、Nachuan川川）。</p><p>肥啾的指路帖：<a href="https://www.bilibili.com/read/cv13612048" target="_blank" rel="noreferrer">https://www.bilibili.com/read/cv13612048</a></p><p>技术生存档案馆：<a href="https://kaihei.co/Jy4Gf4" target="_blank" rel="noreferrer">https://kaihei.co/Jy4Gf4</a></p><p>通常，这些机器都可以直接用于在生存实装（除了物品收集部分），但实装完并不代表你学会了相关的知识。当你能够维修乃至改进这些机器时，表明你已经真正理解了这方面的知识。</p><p>同时，由于生电模块化的特点，在设计机器时往往需要借用现成的优秀模块，因此了解学习他人的设计是必不可少的一环。</p><h3 id="part-3-工具的使用" tabindex="-1">Part 3 | 工具的使用 <a class="header-anchor" href="#part-3-工具的使用" aria-label="Permalink to &quot;Part 3 | 工具的使用&quot;">​</a></h3><p>下文提到的所有mod的汉化包下载地址：<a href="https://www.bilibili.com/video/BV1KN4y1j7ym" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1KN4y1j7ym</a></p><p>mod的下载与安装在后文肥啾的教程中有介绍。或者直接使用XPlus整合包：<a href="https://beta.mcbbs.net/resource/modpack/eerqnkj3" target="_blank" rel="noreferrer">https://beta.mcbbs.net/resource/modpack/eerqnkj3</a></p><h4 id="xekr红石显示" tabindex="-1">XeKr红石显示 <a class="header-anchor" href="#xekr红石显示" aria-label="Permalink to &quot;XeKr红石显示&quot;">​</a></h4><h4 id="litematica-投影" tabindex="-1">Litematica（投影） <a class="header-anchor" href="#litematica-投影" aria-label="Permalink to &quot;Litematica（投影）&quot;">​</a></h4><p>Litematica是生电所使用的最重要的工具，它能高效地帮助玩家在存档之间转移机器与建筑，方便建筑的测试修改与实装。</p><p>肥啾的教程（必看）：<a href="https://www.bilibili.com/video/BV1Qp4y1x7SM" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Qp4y1x7SM</a></p><p>Xekr的教程（更为详细）：<a href="https://www.bilibili.com/video/BV1DJ411X78m/" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1DJ411X78m/</a></p><p>百科的教程：<a href="https://www.mcmod.cn/post/1308.html" target="_blank" rel="noreferrer">https://www.mcmod.cn/post/1308.html</a></p><p>后文将在肥啾的教程上补充。</p><h5 id="模式2补充" tabindex="-1">模式2补充 <a class="header-anchor" href="#模式2补充" aria-label="Permalink to &quot;模式2补充&quot;">​</a></h5><p>当原理图被放下时，在原理图编辑中可以编辑对应的原理图。</p><p><img src="'+n+'" alt="5"></p><p class="desc">原理图编辑</p><ul><li><p>位置：显示/隐藏原理图</p></li><li><p>锁定位置：防止原理图被意外地移动。当原理图被放下时，首先要做的就是锁定位置。</p></li><li><p>旋转/翻转：使原理图旋转或翻转。但是许多机器具有方向性（后续讲解），非必要时请不要旋转机器的原理图！</p></li></ul><h5 id="模式5补充" tabindex="-1">模式5补充 <a class="header-anchor" href="#模式5补充" aria-label="Permalink to &quot;模式5补充&quot;">​</a></h5><p><img src="'+c+'" alt="6"></p><p>在配置界面-通用中，模式5存在着这样一个配置，它会影响粘贴时对现有方块的操作。</p><table tabindex="0"><thead><tr><th>模式\\情况</th><th>原理图有方块</th><th>原理图为空气</th></tr></thead><tbody><tr><td>无</td><td>不替换现有方块</td><td>不替换现有方块</td></tr><tr><td>非空气</td><td>替换现有方块</td><td>不替换现有方块</td></tr><tr><td>所有</td><td>替换现有方块</td><td>替换现有方块</td></tr></tbody></table><p><img src="'+h+'" alt="7"></p><p class="desc">无</p><p><img src="'+d+'" alt="8"></p><p class="desc">非空气</p><p><img src="'+m+'" alt="9"></p><p class="desc">所有</p><h5 id="蓝图显示模式" tabindex="-1">蓝图显示模式 <a class="header-anchor" href="#蓝图显示模式" aria-label="Permalink to &quot;蓝图显示模式&quot;">​</a></h5><p>一些大型的原理图往往难以整个去观察，需要只显示部分蓝图，此时就需要改变显示模式。</p><p><img src="'+b+'" alt="10"></p><p class="desc">位于配置界面-热键</p><p>按下快捷键（此处为L），即可在不同的渲染模式中切换。</p><ul><li><p>默认,All：渲染全部</p></li><li><p>Single Layer：渲染一层，按快捷键（此处为上下）改变显示的y高度</p></li><li><p>Layer Range：渲染一个Y轴区间内（不常用）</p></li><li><p>All below：渲染某个y高度以下，快捷键改变高度</p></li><li><p>All above：渲染某个y高度以上，快捷键改变高度（不常用）</p></li></ul><h5 id="简单放置" tabindex="-1">简单放置 <a class="header-anchor" href="#简单放置" aria-label="Permalink to &quot;简单放置&quot;">​</a></h5><p>简单放置功能用于在生存中准确地建造原理图。当简单放置开启时（此处为Y开关），对准原理图已渲染的方块按下快捷键（此处为鼠标右键），就能将手上的方块切换到对应的方块并放置下来（可以浮空）。同时能阻止你放下错误的方块（有时会失灵）。</p><p><img src="'+A+'" alt="11"></p><p class="desc">位于配置界面-热键</p><p>简单放置的精准度（方向，位于顶部底部、中继器比较器的模式）取决于所使用的协议。</p><p><img src="'+k+'" alt="12"></p><ul><li><p>Version 3：服务端需要装Litematica，支持对红石元件，台阶，活板门，楼梯的精准放置。使用的高校服务器有XJTU。</p></li><li><p>Version 2：服务端需要装Carpet，支持红石元件与台阶的精准放置。楼梯有时会失灵，活板门只能位于顶部。使用的高校服务器有FDC，XJTU。</p></li><li><p>Slab Only：仅支持台阶的精准放置。在绝大部分服务器上可以使用。</p></li></ul><p>此外，当下面的选项打开时，如果背包内没有对应方块而背包的潜影盒内有时，会切换至那个潜影盒。</p><p><img src="'+f+'" alt="13"></p><p class="desc">位于配置界面-通用</p><h5 id="材料列表" tabindex="-1">材料列表 <a class="header-anchor" href="#材料列表" aria-label="Permalink to &quot;材料列表&quot;">​</a></h5><p>​ 当放下原理图后，按下M+L，即可查看所需要的材料。此外在加载原理图界面选中原理图后点击材料列表也可以显示这个界面。</p><p><img src="'+u+'" alt="14"></p><p class="desc">材料列表</p><ul><li><p>显示：统计原理图全部的方块还是只统计渲染的方块</p></li><li><p>信息 HUD：在屏幕的右下角显示不足方块的列表</p></li></ul><p><img src="'+q+'" alt="15"></p><p class="desc">信息HUD</p><h5 id="原理图验证" tabindex="-1">原理图验证 <a class="header-anchor" href="#原理图验证" aria-label="Permalink to &quot;原理图验证&quot;">​</a></h5><p>有时候，原理图自带的染色并不能精确反映其是否影响机器。此时需要按下M+L，可以打开原理图的验证界面，查看更加详细的信息。</p><p><img src="'+P+'" alt="16"></p><p class="desc">原理图验证</p><h5 id="litematica-printer" tabindex="-1">litematica-printer <a class="header-anchor" href="#litematica-printer" aria-label="Permalink to &quot;litematica-printer&quot;">​</a></h5><p>下载页面：<a href="https://modrinth.com/mod/litematica-printer" target="_blank" rel="noreferrer">https://modrinth.com/mod/litematica-printer</a></p><p>Printer是litematica的拓展mod，它允许玩家自动放置已经渲染的方块。Printer可以精准地自动放置放置活板门与楼梯，但是不能支持中继器档位的自动调节，对于大面积的台阶也无能为力；并且在玩家周围方块种类较多时错误率相当高。使用Printer在许多服务器被列为作弊行为，但个人认为Printer可以作为简单放置的一个重要补充，但是完全不能替代简单放置。</p><p><img src="'+g+'" alt="17"></p><p class="desc">位于配置界面-热键</p><p>按下相应的快捷键（此处为Z，默认为CapsLock）即可开启printer，同时无论printer是否开启，按住快捷键（此处为V）也会开始打印。</p><h4 id="tweakeroo" tabindex="-1">Tweakeroo <a class="header-anchor" href="#tweakeroo" aria-label="Permalink to &quot;Tweakeroo&quot;">​</a></h4><p>强大的工具箱（确信）</p><p>X+C：打开Tweakeroo的配置界面，Tweakeroo的一切功能都在配置界面设置。如无说明，则位于配置界面-热键。所有的热键都用于切换功能的开关。</p><h5 id="凭空放置" tabindex="-1">凭空放置 <a class="header-anchor" href="#凭空放置" aria-label="Permalink to &quot;凭空放置&quot;">​</a></h5><p><img src="'+v+'" alt="18"></p><p>开启后，在创造模式下可以凭空放置方块。</p><h5 id="实体攻击限制" tabindex="-1">实体攻击限制 <a class="header-anchor" href="#实体攻击限制" aria-label="Permalink to &quot;实体攻击限制&quot;">​</a></h5><p>开启后，可以防止意外攻击到某些实体（后续讲解，这里可以简单理解为生物）。</p><p><img src="'+w+'" alt="19"></p><p><img src="'+U+'" alt="20"></p><p class="desc">位于列表</p><p>这里可以设置不进行攻击的实体。</p><h5 id="伪潜行" tabindex="-1">伪潜行 <a class="header-anchor" href="#伪潜行" aria-label="Permalink to &quot;伪潜行&quot;">​</a></h5><p><img src="'+T+'" alt="21"></p><p>开启后，类似潜行，不会从边缘掉下去，但是保持原来的速度。伪潜行可以用于快速搭路，但是开启时跳跃会变得困难，因此建议设置一个快捷键。</p><h5 id="屏蔽方块交互" tabindex="-1">屏蔽方块交互 <a class="header-anchor" href="#屏蔽方块交互" aria-label="Permalink to &quot;屏蔽方块交互&quot;">​</a></h5><p><img src="'+R+'" alt="22"></p><p>开启后，放置方块时不会与箱子，漏斗、投掷器、中继器等可以右键互动的方块互动，而直接在旁边放下方块。</p><p>在放置大量箱子，铺设漏斗链与投掷器链时经常要用到这个功能。</p><h5 id="方块快速放置" tabindex="-1">方块快速放置 <a class="header-anchor" href="#方块快速放置" aria-label="Permalink to &quot;方块快速放置&quot;">​</a></h5><p><img src="'+V+'" alt="23"></p><p>开启后，会往一个方向连续放下多个方块。用于铺设大量相同方块（如糊墙，铺地）。注意这个功能在许多服务器是被判定为作弊的。</p><h5 id="左右键快速点击" tabindex="-1">左右键快速点击 <a class="header-anchor" href="#左右键快速点击" aria-label="Permalink to &quot;左右键快速点击&quot;">​</a></h5><p><img src="'+y+'" alt="24"></p><p>开启后，每次按下左右键都会点击多次。在特定情况下会用到（如铁头功破基岩，紫颂花农场种植，手挖区块等）。</p><p><img src="'+J+'" alt="25"></p><p class="desc">位于通用配置</p><p>此处可以调整每gt（1/20s，mc中的最小时间单位）点击的次数，通常1就足够了。</p><h5 id="方块灵活放置" tabindex="-1">方块灵活放置 <a class="header-anchor" href="#方块灵活放置" aria-label="Permalink to &quot;方块灵活放置&quot;">​</a></h5><p><img src="'+Z+'" alt="26"></p><p>开启后，能以特殊的角度放置方块。这是一个经常被人忽视的功能，但是这个功能才是Tweakeroo的精华。</p><p>按住Ctrl键或者Alt键后对准方块，能看到这样一个方框：</p><p><img src="'+S+'" alt="27"></p><p>按住Ctrl，对准相应区域后按右键，将会将方块放在一些正常难以放置的位置（但是原版是可行的）。</p><p><img src="'+N+'" alt="28"></p><p class="desc">中央：橙色染色玻璃（隔空） 四周：红色染色玻璃（对角）</p><p>Alt需要开启Carpet精准放置协议（服务端需要有Carpet,，即支持Litematica的Version2）。</p><p><img src="'+x+'" alt="29"></p><p class="desc">位于通用配置</p><p>按住Alt键，对准相应区域后按右键，能将方块按照相应方向放置。四周就是相应方向，中央是反方向（有时会失灵）。</p><p>在许多收集单片中都有大量对角方块的结构，因此学会灵活放置能极大地方便搭建。</p><h5 id="灵魂出窍" tabindex="-1">灵魂出窍 <a class="header-anchor" href="#灵魂出窍" aria-label="Permalink to &quot;灵魂出窍&quot;">​</a></h5><p><img src="'+z+'" alt="30"></p><p>开启后，视角能像旁观者一样自由移动，但是实际的交互范围仍然在原地。Tweakeroo必开功能。</p><p><img src="'+C+'" alt="31"></p><p class="desc">效果</p><p>如果需要在灵魂出窍时操控本体，就需要打开下面的这个选项。</p><p><img src="'+D+'" alt="32"></p><p class="desc">位于通用配置</p><h5 id="伽马覆写" tabindex="-1">伽马覆写 <a class="header-anchor" href="#伽马覆写" aria-label="Permalink to &quot;伽马覆写&quot;">​</a></h5><p><img src="'+O+'" alt="33"></p><p>开启后，将Gamma值调节为默认1500%，相当于无限夜视。</p><h5 id="自动补货" tabindex="-1">自动补货 <a class="header-anchor" href="#自动补货" aria-label="Permalink to &quot;自动补货&quot;">​</a></h5><p><img src="'+B+'" alt="34"></p><p>开启后，当手上的东西快使用完时，会自动从背包中取半组放在手上。</p><h5 id="长按左右键" tabindex="-1">长按左右键 <a class="header-anchor" href="#长按左右键" aria-label="Permalink to &quot;长按左右键&quot;">​</a></h5><p><img src="'+X+'" alt="35"></p><p>顾名思义，开启后会长按左右键。</p><h5 id="容器预览" tabindex="-1">容器预览 <a class="header-anchor" href="#容器预览" aria-label="Permalink to &quot;容器预览&quot;">​</a></h5><p><img src="'+G+'" alt="36"></p><p>开启后，将视线对准容器后按下快捷键（默认为左Alt），即可在不打开容器的情况下查看里面的物品。</p><p>这个功能需要服务器支持PCA同步协议，否则只能看到近处的容器。</p><h5 id="岩浆夜视" tabindex="-1">岩浆夜视 <a class="header-anchor" href="#岩浆夜视" aria-label="Permalink to &quot;岩浆夜视&quot;">​</a></h5><p><img src="'+L+'" alt="37"></p><p>开启后，如果装备着有水下呼吸附魔的头盔，能在岩浆下看得更清楚。</p><h5 id="周期性单击左右键" tabindex="-1">周期性单击左右键 <a class="header-anchor" href="#周期性单击左右键" aria-label="Permalink to &quot;周期性单击左右键&quot;">​</a></h5><p><img src="'+Q+'" alt="38"></p><p>开启后每隔一段时间单击一下左右键。许多刷怪塔与树厂需要用到这个功能来挂机。</p><p><img src="'+E+'" alt="39"></p><p class="desc">位于通用</p><p>此处可以修改时间间隔，以gt为单位，通常由机器决定。</p><h5 id="潜影盒预览" tabindex="-1">潜影盒预览 <a class="header-anchor" href="#潜影盒预览" aria-label="Permalink to &quot;潜影盒预览&quot;">​</a></h5><p><img src="'+I+'" alt="40"></p><p>开启后，在背包中将鼠标悬停在潜影盒上按下左Shift，可以查看潜影盒内物品。</p><h4 id="itemscroller" tabindex="-1">ItemScroller <a class="header-anchor" href="#itemscroller" aria-label="Permalink to &quot;ItemScroller&quot;">​</a></h4><p>黑山大叔的教程：<a href="https://www.bilibili.com/video/BV1m7411F79T" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1m7411F79T</a></p><p>下文所说的Ctrl、Shift、Alt均为键盘左侧的。</p><h5 id="移动物品" tabindex="-1">移动物品 <a class="header-anchor" href="#移动物品" aria-label="Permalink to &quot;移动物品&quot;">​</a></h5><p>尽管快捷键众多，但是实际应用中常用的只有标蓝的快捷键。且其中唯一不可替代的仅有标粗的快捷键，这是墙面分类仓库取用物品的快捷键。</p><ul><li><p>仅滑动鼠标滚轮: 每次从物品栏间移动一个物品；</p></li><li><p>Shift + 滚动: 每次从物品栏间移动相同的一组物品。当同类物品都移走之后，最后移动鼠标光标所指的这个槽位的一组物品；</p></li><li><p>Ctrl + 滚动: 一次性从物品栏间移动所有同种物品；</p></li><li><p>Alt + 点击: 一次性从物品栏间移动所有同种物品（同 Ctrl + 滚动）；</p></li><li><p>Ctrl + Shift + 滚动: 一次性从物品栏间移动所有物品；</p></li><li><p>Alt + Shift + 单击: 一次性从物品栏间移动所有物品（同 Ctrl+ Shift + 滚动）；</p></li><li><p>Shift + 左键按住 + 拖动: 移走堆叠的所有物品；</p></li><li><p>Shift + 右键按住 + 拖动: 移走堆叠的所有物品，但是最后留下一个；</p></li><li><p>Ctrl + 左/右键按住 + 拖动: 所有物品每格取走一个；</p></li><li><p>Shift + 单击有物品的空槽位: 把所有匹配的物品放到那个槽位；</p></li><li><p>Shift + 单击物品栏外:把所有匹配的物品全部丢掉；</p></li><li><p>Ctrl + Q（丢弃键） + 左/右键按住 + 拖动: 从所有拖过的槽位中丢掉一个物品；</p></li><li><p>Shift + Q（丢弃键） + 左键按住 + 拖动: 从所有拖过的槽位中丢掉所有物品；</p></li><li><p>Shift + Q（丢弃键） + 右键按住 + 拖动: 从所有拖过的槽位中丢掉所有物品，但是最后留下一个；</p></li><li><p>Ctrl + Shift + Q：丢弃所有指针指着的物品；</p></li><li><p>W/S + Shift/Ctrl + 单击 (或拖动): 在物品栏中上 (W) 下 (S) 移动物品。</p></li></ul><h5 id="快速合成" tabindex="-1">快速合成 <a class="header-anchor" href="#快速合成" aria-label="Permalink to &quot;快速合成&quot;">​</a></h5><p>快速合成的几个快捷键缺一不可，这是喷射合成的基础。</p><ul><li><p>A：打开合成收藏界面</p></li><li><p>A + 数字键：选择相应的合成表</p></li><li><p>鼠标中键：保存合成表</p></li><li><p>Ctrl + C：根据选择的合成表消耗背包内所有需要的物品合成物品</p></li><li><p>Ctrl + Alt + C：在Ctrl + C的基础上抛出合成的物品</p></li></ul><h4 id="minihud" tabindex="-1">Minihud <a class="header-anchor" href="#minihud" aria-label="Permalink to &quot;Minihud&quot;">​</a></h4><h4 id="carpet" tabindex="-1">Carpet <a class="header-anchor" href="#carpet" aria-label="Permalink to &quot;Carpet&quot;">​</a></h4><h2 id="episode-2-常见的模块" tabindex="-1">Episode 2 | 常见的模块 <a class="header-anchor" href="#episode-2-常见的模块" aria-label="Permalink to &quot;Episode 2 | 常见的模块&quot;">​</a></h2><p>在学习这一章的过程中，最好去找一些简单的生电机器来对照着看（如黑山大叔、肥啾U_ruby、Nachuan川川的机器，都面向初学者；同样可以参照FDC内的机器），来更好地理解后面所说的知识；在学习完这个模块后，你就能够理解绝大部分生电机器的基本构建，并自己设计优化一些机器。</p><h3 id="图例" tabindex="-1">图例 <a class="header-anchor" href="#图例" aria-label="Permalink to &quot;图例&quot;">​</a></h3><ul><li>铁块，钻石块：在实际应用中通常使用铁块、平滑石头、石英块来替换。用于代表实体方块。钻石块用来代表模块输入信号的地方。旁边为侦测器则表示接受侦测器信号，为红石线表示接受长信号。</li><li>黑色染色玻璃：在实际应用中通常使用白色染色玻璃、平滑石台阶、石英台阶来替换；又是为了方便也会使用铁块等来替代，但十分不建议这样做。用来代表透明方块。</li></ul><h3 id="part-1-物品收集模块" tabindex="-1">Part 1 | 物品收集模块 <a class="header-anchor" href="#part-1-物品收集模块" aria-label="Permalink to &quot;Part 1 | 物品收集模块&quot;">​</a></h3><p>物品收集模块指机器中用于将掉落物收集到容器（箱子、潜影盒、木桶）的部分。</p><p>Nachuan川川的教程（必学）：<a href="https://www.bilibili.com/video/BV1PQ4y1C7Rp" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1PQ4y1C7Rp</a></p><p>后文将在川川的教程上进行补充，初学时可能会感到困难，可以先跳到Part 2。</p><h4 id="物品流分析" tabindex="-1">物品流分析 <a class="header-anchor" href="#物品流分析" aria-label="Permalink to &quot;物品流分析&quot;">​</a></h4><p>在设计一个机器的收集模块时，不能单独看其纸面数据来计算所需漏斗倍速，还要根据其输出物品流的类型来设计。</p><h5 id="涓流与冲击流" tabindex="-1">涓流与冲击流 <a class="header-anchor" href="#涓流与冲击流" aria-label="Permalink to &quot;涓流与冲击流&quot;">​</a></h5><p>涓流指该机器持续输出物品或者两次输出之间间隔很短，形成的持续不断的物品流，绝大部分机器输出的是涓流。</p><p>冲击流指该机器并不是持续输出物品，而是间隔一段时间后输出大量物品，从而形成短时间大量的物品流。由于冲击流的特点，在机器输出的间隔内漏斗往往已经传输完其中缓存的物品而不工作，这使得单个漏斗的效率会远小于9k/h，因此在设计接受冲击流的物品收集模块时，不能仅仅根据纸面数据计算，而是需要结合机器的运行周期来计算。</p><p><img src="'+K+'" alt="41"></p><p>最典型的例子就是刷花机。以肥啾U_ruby的刷花机单元为例，如果只刷一种花（如矢车菊），纸面数据为：</p><p>矢车菊：40k/h ，</p><p>小麦种子：40k/h</p><p>如果仅从纸面数据来计算，共需要10个漏斗收集物品；如果销毁小麦种子仅需5个。但如果仅使用5个漏斗，你将会发现大量的矢车菊也被销毁了。这是因为刷花机的物品流为典型的冲击流，每16s输出178个矢车菊。而一个漏斗单次只能吸收23~26个物品，计算下来需要8个漏斗而非5个。</p><p>循环水道是一个不错的将冲击流转化为涓流的方式，但是其缺点也很明显：体积较大，且一旦遭遇爆仓或潜影盒不足就会有大量物品堆积在水道中，造成巨量卡顿。如果为了防止物品堆积而修筑盒子仓库，则会使体积进一步增大。而对于刷花机这样一个小巧的机器来说，构筑那么大的仓库显然不太合适。</p><p>实际上，即使是涓流，输出的物品数量也会随着时间而周期性或非周期性地上下浮动，这使得在设计收集时，往往需要设计多余的漏斗或者循环水道来保证所有物品被吸收。</p><h5 id="复杂物品流" tabindex="-1">复杂物品流 <a class="header-anchor" href="#复杂物品流" aria-label="Permalink to &quot;复杂物品流&quot;">​</a></h5><p>复杂物品流指那些输出物品种类极多，混杂有大量不可堆叠物品（垃圾）的物品流，典型的例子为手砍猪人塔、凋灵骷髅塔、猪灵交易所。这使得这些机器无法使用循环水道，否则会迅速堆积大量垃圾。但是这些机器输出的物品流往往具有着一定冲击流的性质，峰值与谷值间相差较大，在设计收集时也需要大量的多余漏斗。</p><h5 id="变化物品流" tabindex="-1">变化物品流 <a class="header-anchor" href="#变化物品流" aria-label="Permalink to &quot;变化物品流&quot;">​</a></h5><p>变化物品流指该机器输出的物品流并不包含固定的物品，而且随着输入的物品变化而变化。典型的例子有刷沙固化机与熔炉组。应对这种物品流，通常有三种方案：</p><p>a.对所有物品进行编码分类打包，缺点是体积十分大，对于高效率的机器往往无能为力。</p><p>b.混杂打包，缺点是物品混杂，取用十分难受。</p><p>c.自适应打包，缺点是对建造者与使用者的知识要求较高，对不满盒的处理相对麻烦。</p><h5 id="ab大吸力分类单片" tabindex="-1">AB大吸力分类单片 <a class="header-anchor" href="#ab大吸力分类单片" aria-label="Permalink to &quot;AB大吸力分类单片&quot;">​</a></h5><p>正如上文所言，在设计收集时往往需要设计多余的漏斗，来应对物品流的上下波动。这使得末端的漏斗往往跑不到9k/h的效率，只是用于保证在物品流峰值保证被吸收。那么有什么办法能提升漏斗的平均效率，从而减少多余漏斗的使用呢？</p><p><strong>下面是本节结论的推导过程。如果你对于红石元件的功能完全不了解，可以先暂时跳过这段；但是如果你能够理解基础单片的运作原理，请看看下面的推导过程，能拓宽你设计收集的思路。</strong></p><blockquote><p>如果你仔细看了川川的教程，你能发现在其中提到了一种相对不安全的分类单片：</p><p><img src="'+j+'" alt="42"></p><p>这种分类单片填充物品的样式为[18,1,1,1,1]，相较于普通的分类单片，这种分类单片单次能吸收更多的物品。但是当这种单片一次吸收大量物品时，输出的3格信号会解锁旁边分类单片的漏斗（红石信号“串”到了并行的其他的红石“线”上），导致旁边分类单片损坏，因此这种单片不能够堆叠。</p><p>那么，只要不去堆叠这种单片，不就消除了串线的风险了吗？同时，由于消除了串线的风险，可以使用一种更为激进的填充方法:[1,18,1,1,1]。这样能单次吸收63个物品，大于两个普通的分类单片，变相提升了单个漏斗的效率。这样就得到了一种大吸力分类单片。</p><p>此外，由于不去堆叠，两个大吸力单片中间还可以插入普通的分类单片或者另一种大吸力分类单片，只要能保证这两种单片之间不会串线。那么，如何保证这点呢？可以将两种单片的红石线放在不同的高度上，在对角处放上不透明方块来隔断，就能保证两种单片之间不会串线。将两种大吸力的单片进行堆叠，就能得到一种相对成熟的AB大吸力分类单片设计。</p></blockquote><p>AB，指将两种单片或者物品进行交替使用。相较于普通的堆叠设计，AB的设计施工更加复杂，体积更大，但是拥有着更加优越的性能与稳定性。下面是一种常见的AB大吸力分类单片：</p><p><img src="'+H+'" alt="43"></p><p class="desc">A单片</p><p><img src="'+M+'" alt="44"></p><p class="desc">B单片</p><p><img src="'+F+'" alt="45"></p><p class="desc">组合</p><p>填充物样式为[1,18,1,1,1]。这种设计每个漏斗每次能吸收（缓存）63个物品，远超常规的设计，因此能够应对物品数量波动较大的物品流。</p><h3 id="part-2-物品采集模块" tabindex="-1">Part 2 | 物品采集模块 <a class="header-anchor" href="#part-2-物品采集模块" aria-label="Permalink to &quot;Part 2 | 物品采集模块&quot;">​</a></h3><p>物品采集模块指机器中将再生物（方块、生物等）转化为物品的部分。不同于物品收集模块，不同机器的物品采集模块差异相当大，从相对复杂的推爆室到仙人掌农场的几根栅栏，都属于物品采集模块。后面会介绍一些相对通用的物品采集模块。</p><h4 id="tnt复制-方块、生物" tabindex="-1">TNT复制（方块、生物） <a class="header-anchor" href="#tnt复制-方块、生物" aria-label="Permalink to &quot;TNT复制（方块、生物）&quot;">​</a></h4><p>TNT复制指基于活塞特性来对点燃的TNT进行复制。通过复制TNT来爆破方块，就能自动地破坏方块、伤害生物。</p><p>黑山大叔的教程：<a href="https://www.bilibili.com/video/BV1CK411d7kF" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1CK411d7kF</a></p><p>以下原理部分源自wiki，里面的一些名词对于初学者而言有些难，同样可以暂时跳过。</p><blockquote><h4 id="原理" tabindex="-1">原理 <a class="header-anchor" href="#原理" aria-label="Permalink to &quot;原理&quot;">​</a></h4><p>TNT复制的原理与活塞机制有关。在活塞被激活或撤销激活时，活塞会检测需要被移动的所有方块，并将其按一定顺序加入到一个列表中。然后，活塞会开始推动方块，这些列表中的方块均将逐一变为“移动的活塞”（B36）方块而开始移动，之后被移动但未被其他移动的方块覆盖的方块被删除。若TNT在方块列表产生后、TNT被覆盖或删除前的时间里被触发，那么生成一个点燃的TNT实体的同时，由于已生成的“移动的活塞”及方块列表不会发生改变，依旧会生成对应着TNT的“移动的活塞”方块。2游戏刻后，“移动的活塞”方块重新变回普通方块，而TNT方块也就重新生成，从而达成复制。</p><h4 id="方块更新" tabindex="-1">方块更新 <a class="header-anchor" href="#方块更新" aria-label="Permalink to &quot;方块更新&quot;">​</a></h4><p>方块列表产生后、TNT被覆盖或删除前的时间里，计划刻、区块刻、方块事件（移动TNT的活塞的方块事件除外）、实体、方块实体均不会运算，移动TNT的活塞和它移动的多数方块也不能发出NC更新，TNT仅能被<strong>活塞直接或间接破坏的方块</strong>、<strong>被移动的激活的侦测器</strong>或<strong>避雷针</strong>和其他被复制的TNT更新。</p><p>可自动循环的复制机除了用激活的侦测器更新TNT，还可以用活塞移动或破坏支撑雪的方块使雪发出NC更新。移动TNT的活塞同时移动的地毯和珊瑚扇的破坏同样也不影响其对应的“移动的活塞”方块的产生，移动到位后它们也会正常生成，不会消耗。</p><p>通常会使用珊瑚扇来给予TNT方块更新。需要注意的是，有些结构是推出复制，有些结构是收回复制，而有些是两者都复制，这和更新顺序（珊瑚扇附着的黏液块转变为“移动的活塞”（B36）是否先于珊瑚扇的转变）有关。</p><h4 id="激活" tabindex="-1">激活 <a class="header-anchor" href="#激活" aria-label="Permalink to &quot;激活&quot;">​</a></h4><p>活塞开始运动无法直接向TNT输入上升沿，间接输入也难，因此玩家常在活塞运动前使TNT处于BUD态，这样方块列表产生后提供NC更新就能复制TNT。</p></blockquote><h5 id="侦测器设计" tabindex="-1">侦测器设计 <a class="header-anchor" href="#侦测器设计" aria-label="Permalink to &quot;侦测器设计&quot;">​</a></h5><p>顾名思义，侦测器设计指使用侦测器引发TNT更新的设计。通常，使用这种设计的TNT复制耗材少，无实体而方便建造，但难以运用于飞行器上，因此被广泛运用于许多机器上。</p><p>需要注意的是，许多侦测器涉及的TNT复制具有着方向或者坐标的限制。对于某个侦测器设计，只能去判断它是否拥有这些限制，但是它会在哪个方向或者坐标失灵则完全依靠测试，甚至在不同服务器上会得到完全相反的结果。对于这种限制的成因尚不明晰。</p><h5 id="金合欢三无-变种" tabindex="-1">金合欢三无&amp;变种 <a class="header-anchor" href="#金合欢三无-变种" aria-label="Permalink to &quot;金合欢三无&amp;变种&quot;">​</a></h5><p><img src="'+Y+'" alt="46"></p><p><img src="'+W+'" alt="47"></p><p>作为最常使用的TNT复制，其具有着许多的优点：耗材少，易于连接，爆炸点准确，无方向坐标限制等。</p><p><img src="'+_+'" alt="48"></p><p><img src="'+$+'" alt="49"></p><p>这是上面TNT复制的一个变种，相较于原版耗材更少，但是变得具有方向性，仅用于单个使用。</p><p><img src="'+aa+'" alt="50"></p><p class="desc">串联</p><h5 id="水星嗷三无" tabindex="-1">水星嗷三无 <a class="header-anchor" href="#水星嗷三无" aria-label="Permalink to &quot;水星嗷三无&quot;">​</a></h5><p><img src="'+ea+'" alt="51"></p><p><img src="'+ta+'" alt="52"></p><p>相较于金合欢的三无，这款TNT复制的耗材更少，但是有在特定坐标失效的风险。相较于串联，这种TNT复制模块更适合横向堆叠或者竖向堆叠。</p>',241)]))}const da=e(ia,[["render",ra]]);export{ha as __pageData,da as default};
